    }
  return (
    <>
    <button type="button" className="btn btn-secondary btn-lg m-4" onClick={openReg}>Large button</button>
    <button type="button" className="btn btn-secondary btn-lg m-4" onClick={openReg}>Large button</button>
    </>
  )
}

 export default Cards
